import NavBar from '../nav.js'
import './style.css'

function GetStartedButton(props) {
    return <a className ='btn btn-primary
        fs-2 fw-bolder' 
        href="/sign_up" >
        Get Started...
    </a>
}

function GettingStartedView(props) {
    return <div 
        className="getting-started-container 
            hovered">

        <h1 className='getting-starting-text'>Personal Finance Manger</h1>
        <GetStartedButton/>

    </div>
}

export default function LandingPage(props) {
    return <div className = "container">

        <GettingStartedView/>

    </div>
}



